export const fetchJobs = async () => {
    return fetch('./json/planning.json'
        , {
            headers: {
                'Content-Type': 'application/json',
                'Accept': 'application/json'
            }
        }
    )
        .then(function (response) {
            console.log(response)
            return response.json();
        })
        .then(function (result) {
            console.log(result);
            return result
        });
}
